Science Documentary hosted by Rick Robles, published by Discovery Channel in 2012 - English narration


Information
------------------------------

Reign of the Dinosaurs
Combining the talent of the world's best animators, the latest paleontological research and Hollywood style storytelling Reign of the Dinosaurs illustrates the extraordinary life of dinosaurs. If you thought Dinosaurs were just over-sized, sluggish grey reptiles then think again as this brand new series drops viewers directly into the Prehistoric era and showcases the ancient world like seen never before. Presented with sparse narration, the latest cutting-edge animation and computer generated storytelling techniques; this new series features never-before-seen intimate behaviours and puts the life of dinosaurs into a whole new light.




4)  End Game 
Gigantic and menacing, the Tyrannosaurus Rex is probably the most famous dinosaur that ever lived. However, new discoveries are proving wrong the previous depiction of the T.Rex as dull and slow -- in fact, he was complex, dynamic and even bird-like. We get an up close and personal look at how they lived, from nesting in pairs to caring for their young and how they played together. The reign of the T.Rex ended when the impact of a huge asteroid hurtling toward Earth decimated the dinosaur population -- but not all dinosaurs died. A few survivors such as Troodon, a small, bird-like dinosaur and the smartest dinosaur to ever live, may have hung on, yet eventually it, too, succumbed to the catastrophe. Watch as a lone Troodon -- &quot;the last dinosaur&quot; -- struggles to survive in a post-apocalyptic world. But our Troodon may not really be the last dinosaur. If birds are their descendants, then we're still living in the Age of Dinosaurs -- and the Reign of the Dinosaur continues.

